{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"**BACKGROUND:**\n\nBellabeat is a high-tech manufacturer of health-focused products for women. They are a small company, but they have the potential to become a larger player in the global smart device market. Their Co-founder and Chief Creative Officer, Urška Sršen, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company.\nCurrently, their products include:\n\n**Bellabeat app:** The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n\n**Leaf:** Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n\n**Time:** This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n\n**Spring:** This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n\n**Bellabeat membership:** Bellabeat also offers a subscription-based membership program for users.\nMembership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on their lifestyle and goals.","metadata":{}},{"cell_type":"markdown","source":"**ASK**\n\n**Business Task:**\n\nTo analyze fitbit data to gain insights into how users are using their smart devices and apply these trends to one of Bellabeat's products to guide marketing strategy.","metadata":{}},{"cell_type":"markdown","source":"**Key Stakeholders:**\n\n***Urška Sršen:*** Bellabeat’s cofounder and Chief Creative Officer\n\n***Sando Mur*** Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n\n***Bellabeat marketing analytics team:*** A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy.","metadata":{}},{"cell_type":"markdown","source":"**PREPARE**\n\nThe FitBit Fitness Tracker dataset is made available through Mobius, and can be downloaded from Kaggle. The data set contains personal fitness tracker from thirty fitbit users who consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. The data does not fully ROCCC. It is not reliable as it only sampled 33 unique users over a one-month period and therefore might have sampling bias. It is not original, as it was collected by a third-party. It is also not comprehensive as only eight users submitted weight data. The dataset is not current, since it was collected in 2016. The only saving grace for this dataset is that it's cited. Nonetheless, we'll clean and analyze the data.","metadata":{}},{"cell_type":"markdown","source":"**PROCESS**\n\nI'm choosing R to clean this data because I feel comfortable using it for both small and large datasets. I also used Excel to view and clean some of the data. I used formulas such as str() and head() to ensure that my data was clean and ready for analysis.\n\nTo start off with data cleaning, we need to install and load the necessary packages for cleaning and analyzing data in R.","metadata":{}},{"cell_type":"code","source":"install.packages(\"tidyverse\")\ninstall.packages(\"skimr\")\ninstall.packages(\"janitor\")\ninstall.packages(\"lubridate\")\ninstall.packages(\"ggplot2\")","metadata":{"execution":{"iopub.status.busy":"2022-11-16T14:54:24.785450Z","iopub.execute_input":"2022-11-16T14:54:24.787865Z","iopub.status.idle":"2022-11-16T14:55:46.723825Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"library(tidyverse)\nlibrary(skimr)\nlibrary(janitor)\nlibrary(lubridate)\nlibrary(ggplot2)","metadata":{"execution":{"iopub.status.busy":"2022-11-20T08:16:56.018638Z","iopub.execute_input":"2022-11-20T08:16:56.020459Z","iopub.status.idle":"2022-11-20T08:16:57.634395Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.5 \n\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.1 \n\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.3      \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2 \n── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n\nAttaching package: ‘janitor’\n\n\nThe following objects are masked from ‘package:stats’:\n\n    chisq.test, fisher.test\n\n\n\nAttaching package: ‘lubridate’\n\n\nThe following objects are masked from ‘package:base’:\n\n    date, intersect, setdiff, union\n\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"Then, we import the datasets into RStudio 