e_input":"2022-11-20T08:19:49.326001Z","iopub.status.idle":"2022-11-20T08:19:49.348374Z"},"trusted":true},"execution_count":18,"outputs":[]},{"cell_type":"markdown","source":"I added a column to the sleep_data data set for total sleep time by using the mutate() function and diving by 60 to convert from minutes to hours.","metadata":{}},{"cell_type":"code","source":"sleep_data <- mutate(sleep_data, total_sleep_hours = sleep_data$total_time_in_bed/60)","metadata":{"execution":{"iopub.status.busy":"2022-11-20T08:19:58.953172Z","iopub.execute_input":"2022-11-20T08:19:58.954384Z","iopub.status.idle":"2022-11-20T08:19:58.966233Z"},"trusted":true},"execution_count":19,"outputs":[]},{"cell_type":"markdown","source":"I rounded the new columns to two decimal places so that the data looks clean and consistent.","metadata":{}},{"cell_type":"code","source":"daily_activity$total_active_hours <- round(daily_activity$total_active_hours, digits = 2)\ndaily_activity$sedentary_hours <- round(daily_activity$sedentary_hours, digits = 2)\nsleep_data$total_sleep_hours <- round(sleep_data$total_sleep_hours, digits = 2)","metadata":{"execution":{"iopub.status.busy":"2022-11-20T08:20:04.834276Z","iopub.execute_input":"2022-11-20T08:20:04.835601Z","iopub.status.idle":"2022-11-20T08:20:04.850770Z"},"trusted":true},"execution_count":20,"outputs":[]},{"cell_type":"markdown","source":"I removed rows from daily_activity$calories and daily_activity$total_active_hours which have a value of zero because zero would mean users had switched off their smart devices and therefore this data was irrelevant to out analysis.","metadata":{}},{"cell_type":"code","source":"daily_activity <- filter(daily_activity, calories != 0 & total_active_hours != 0.00)","metadata":{"execution":{"iopub.status.busy":"2022-11-20T08:20:11.189942Z","iopub.execute_input":"2022-11-20T08:20:11.191270Z","iopub.status.idle":"2022-11-20T08:20:11.226830Z"},"trusted":true},"execution_count":21,"outputs":[]},{"cell_type":"markdown","sourc