data":{}},{"cell_type":"code","source":"write.csv(daily_activity, file = 'bellabeat_daily_activity.csv')\nwrite.csv(weight_data, file = 'bellabeat_weight_data.csv')  \nwrite.csv(sleep_data, file = 'bellabeat_sleep_data.csv')\nwrite.csv(heartrate_data, file = 'bellabeat_heartrate_data.csv')\nwrite.csv(daily_steps, file = 'bellabeat_daily_steps.csv')","metadata":{"execution":{"iopub.status.busy":"2022-11-20T08:20:50.735755Z","iopub.execute_input":"2022-11-20T08:20:50.737167Z","iopub.status.idle":"2022-11-20T08:21:19.485663Z"},"trusted":true},"execution_count":26,"outputs":[]},{"cell_type":"markdown","source":"Here are the visualizations I made from Tableau and Power BI.","metadata":{}},{"cell_type":"markdown","source":"<div class='tableauPlaceholder' id='viz1668693595497' style='position: relative'><noscript><a href='#'><img alt=' ' src='https:&#47;&#47;public.tableau.com&#47;static&#47;images&#47;Be&#47;BellabeatFitnessData_16686916926140&#47;AverageActiveHoursbyWeekDay&#47;1_rss.png' style='border: none' /></a></noscript><object class='tableauViz'  style='display:none;'><param name='host_url' value='https%3A%2F%2Fpublic.tableau.com%2F' /> <param name='embed_code_version' value='3' /> <param name='site_root' value='' /><param name='name' value='BellabeatFitnessData_16686916926140&#47;AverageActiveHoursbyWeekDay' /><param name='tabs' value='yes' /><param name='toolbar' value='yes' /><param name='static_image' value='https:&#47;&#47;public.tableau.com&#47;static&#47;images&#47;Be&#47;BellabeatFitnessData_16686916926140&#47;AverageActiveHoursbyWeekDay&#47;1.png' /> <param name='animate_transition' value='yes' /><param name='display_static_image' value='yes' /><param name='display_spinner' value='yes' /><param name='display_overlay' value='yes' /><param name='display_count' value='yes' /><param name='language' value='en-US' /></object></div>                <script type='text/javascript'>                    var divElement = document.getElementById('viz1668693595497');                    var vizElement = divElement.getElementsByTagName('object')[0];                    vizElement.style.width='100%';vizElement.style.height=(divElement.offsetWidth*0.75)+'px';                    var scriptElement = document.createElement('script');                    scriptElement.src = 'https://public.tableau.com/javascripts/api/viz_v1.js';                    vizElement.parentNode.insertBefore(scriptElement, vizElement);                </script>","metadata":{}},{"cell_type":"markdown","source":"<iframe title=\"Trends in Fitbit Smart Device Usage\" width=\"600\" height=\"373.5\" src=\"https://app.powerbi.com/view?r=eyJrIjoiNmYxOTIwNTgtNDlmOS00ZmI1LWE3MmEtMTU5YmRmY2VhMzQyIiwidCI6ImRmODY3OWNkLWE4MGUtNDVkOC05OWFjLWM4M2VkN2ZmOTVhMCJ9&embedImagePlaceholder=true&pageName=ReportSection\" frameborder=\"0\" allowFullScreen=\"true\"></iframe>","metadata":{}},{"cell_type":"markdown","source":"**Insights from Analysis**\n\n1. Users recorded the highest level of activity on Tuesday.\n2. However, users spend most of their time sedentary (79.23%) while only spending 1.93% of their time engaged in vigorous activity.\n3. Users are only active an average of 4 hours a day.\n4. There is a proportional relationship between the total steps/total distance and the amount of calories burned.\n","metadata":{}},{"cell_type":"markdown","source":"**ACT**\n\nBased on my analysis of the data, Bellabeat should start by promoting their **Time** product, the wellness watch that combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide users with insights into their daily wellness.\nBy promoting the **Time** product, it triggers a domino effect, with users now tracking their activity, sleep, and stress levels on the **Bellabeat app** and getting recommendations on how to improve their wellness. Bellabeat can then promote the Bellabeat app to users by running challenges, customizing milestones and offering reward points to customers who engage in vigorous activity and healthy sleep patterns. The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. \nSince the Bellabeat app connects to their line of smart wellness products, Bellabeat can also use the app to promote their other products. For example, they could promote the **Spring** water bottle that tracks daily water intake using smart technology to ensure that users are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track hydration levels and provide recommendations when users are not sufficiently hydrated.","metadata":{}}]}